import React, { useEffect } from "react";
import { connect } from "react-redux";
import { fetchEnglishTable } from "../../Redux/actions/Actions";
import Matches from "../matches/Matches";
const League = props => {
  useEffect(() => {
    props.getLeagueTable();
  }, [props.leagueTable]);
  console.log(props.leagueTable);
  return (
    <div className="league-header">
      <h2>ihi</h2>
      <h4>aidioad</h4>
      <h5>Check Matches Dates and Results</h5>

      <div className="table"></div>
      <div className="topscorers"></div>
    </div>
  );
};
const mapStateToProps = state => ({
  leagueTable: state.EnglishTable
});
const mapDispatchToProps = dispatch => {
  return { getLeagueTable: () => dispatch(fetchEnglishTable()) };
};

export default connect(mapStateToProps, mapDispatchToProps)(League);
